def compute_catalan(n):
    if n >= 400 and n - 400 < len(PRECOMPUTED):
        return PRECOMPUTED[n - 400]
    
    catalan = 1
    for k in range(2, n + 1):
        catalan *= (n + k) / k
    return catalan


def absolute_compare(v1, v2):
    epsilon = 0.5
    if v1 > v2:
        return v1 - v2 < epsilon
    else:
        return v2 - v1 < epsilon


def guess_catalan(catalan):
    found = False
    guess = 1
    while not found:
        catalan_guess = compute_catalan(guess)
        if absolute_compare(catalan, catalan_guess):
            found = True
        else:
            guess += 1
    
    return guess + 2


def main():
    while True:
        try:
            line = input()
            catalan = int(line)
            print(guess_catalan(catalan))
        except (EOFError):
            break


